import React from 'react';

function ThankYouPage({ match }) {
  const { fullName, stdid, level, subj, about } = match.params;

  return (
    <div>
      <h1>ขอบคุณที่สมัคร!</h1>
      <p>ชื่อ-สกุล: {fullName}</p>
      <p>รหัสนักศึกษา: {stdid}</p>
      <p>ชั้นปี: {level}</p>
      <p>หลักสูตร: {subj}</p>
      <p>ฝ่ายที่สนใจ: {about}</p>
      {/* แสดงข้อมูลอื่นๆ ตามต้องการ */}
    </div>
  );
}

export default ThankYouPage;
